script: |
  super -f tsv -I q1369.sql | sort > q1369.out

vector: true

inputs:
  - name: q1369.sql
    data: |
      SELECT d-e,
      a,
      b
      FROM t1
      WHERE (e>a AND e<b)
      AND d NOT BETWEEN 110 AND 150
      ORDER BY 2,3,1;
  - name: t1

outputs:
  - name: q1369.out
    data: |
      -2	191	194
      1	220	223
      2	245	249
